import React from "react";
import styled from "styled-components";
import Footer from "../Footer/Footer";
import Header from "../Header/Header";
const Nav = styled.div`
  width: 100%;
  padding-top: 114px;
  padding-bottom: 13.5px;
  border-bottom: 1px solid #dbdbdb;
  margin-bottom: 60px;
  display: flex;
  justify-content: center;
  position: relative;
  & > .wrapper {
    display: grid;
    grid-template-columns: repeat(2, 169px);
    & > div {
      font-size: 17px;
      font-weight: 500;
      color: #434343;
      cursor: pointer;
    }
  }
  & > .bar {
    width: 169px;
    height: 3px;
    background-color: #47d99b;
    position: absolute;
    bottom: 0;
    left: 0;
  }
`;
function Support() {
  return (
    <React.Fragment>
      <header>
        <Header />
      </header>
      <Nav>
        <div className="wrapper">
          <div>공지사항</div>
          <div>지원사업</div>
        </div>
        <div className="bar" />
      </Nav>
      <Footer />
    </React.Fragment>
  );
}

export default Support;
